import Header from "./Header";
import Card from "./Card";

function Main({cards}) {
  

  return (
    <>
      <Header />
      <main className="content">
      <section className="elements">
      <article className="element">
            <button className="element__add-button" />
        </article>
        {cards.map((card) => {
          return (
            <Card/>
          );
        })}
      </section>
    </main>
    <model-viewer src="bathroom2.glb" ar ar-modes="webxr scene-viewer quick-look" camera-controls poster="poster.webp" shadow-intensity="1">
    <div class="progress-bar hide" slot="progress-bar">
        <div class="update-bar"></div>
    </div>
    <button slot="ar-button" id="ar-button">
        View in your space
    </button>
    <div id="ar-prompt">
        <img src="https://modelviewer.dev/shared-assets/icons/hand.png" alt=""/>
    </div>
    </model-viewer>

    <model-viewer
      className="model-viewer"
      src="../vendor/models/bathroom/bathroom2.glb"
      alt="A rock"
      exposure="0.008"
      camera-controls
      ar
      ar-modes="webxr"
    >
    </model-viewer>
    </>
  );
}

export default Main;
